import React from "react";
import ReactDOM from "react-dom";
import Image from "./Mep";
import Photo from "./Narr";

//console.log(image[0].img);

//const M =image.map(function(index){
  //return index;
//})


ReactDOM.render(
  <>
<span>
<Photo img={Image[0].imge}
       imgno={Image[0].imgeno}
/>

<Photo img={Image[1].imge}
       imgno={Image[1].imgeno}


/>
<Photo img={Image[2].imge}
       imgno={Image[2].imgeno}
/>
<h1>hey bro</h1>


</span>
</>,
document.getElementById('root'));
